import React from 'react';
import './App.css';
import Comment from './components/Comment'

function App() {
  return (
    <div className="ui container comments">
      <Comment author = 'Sam' timeAgo = 'Today at 4pm' content='Great!'/>
    </div>
  );
}

export default App;
